import React from 'react';
import Softphone from './Softphone';

function Phone() {
    const [remoteId, setRemoteId] = useState('');
    const [session, setSession] = useState(null);
    const [peer, setPeer] = useState(null);

    function handleDial(event) {
        event.preventDefault();
        Softphone.makeCall(remoteId);
    }

    function handleHangup() {
        Softphone.hangup();
    }

    function handleReject(incomingInvite) {
        Softphone.reject(incomingInvite);
    }

    return (
        <div>
            <form onSubmit={handleDial}>
                <label>
                    Enter remote ID:
                    <input
                        type="text"
                        value={remoteId}
                        onChange={event => setRemoteId(event.target.value)}
                    />
                </label>
                <button type="submit">Dial</button>
            </form>
            {peer ? (
                <button onClick={handleHangup}>Hang up</button>
            ) : (
                <div>
                    {session ? (
                        <button onClick={() => handleReject(session)}>Reject</button>
                    ) : null}
                    <button onClick={() => Softphone.answerCall(session)}>
                        Answer
                    </button>
                </div>
            )}
        </div>
    );
}

export default Phone;
